description:
When a female assassin is sent to the U.S. to kill the last living heir to the modern-day Himalayan Kingdom, a royal soldier is also sent to protect the princess.

When he is face-to-face with the assassin, his duty to the Kingdom becomes compromised. As they battle, secrets are uncovered and the line between good and evil is erased. Only one mission can be completed and only one person can survive...

